import React from "react";
import "./styles/EmployeeTable.css";

class EmployeeTable extends React.Component {
  render() {
    return (
      <div className="container__component">
        <div className="container__table">
          <table>
            <thead>
              <tr>
                <th>Name</th>
                <th>E-mail</th>
                <th>Role</th>
                <th>DOB</th>
                <th>Gender</th>
              </tr>
            </thead>
            <tbody>
              {
                this.props.updateTable.map((element) => {
                  return (
                    <tr key={element.id}>
                      <td>{element.name}</td>
                      <td>{element.email}</td>
                      <td>{element.role}</td>
                      <td>{element.dob}</td>
                      <td>{element.gender}</td>
                    </tr>
                  );
                })

                /* <tr>
            <td>Raynulfo Mataaaaaaaaaaaaaaadsd</td>
            <td>rainulfomata@gmail.com</td>
            <td>Raynulfosssssssssssssssss</td>
            <td>09/09/2003</td>
            <td>Female</td>
          </tr> */
              }
            </tbody>
          </table>
        </div>
      </div>
    );
  }
}

export default EmployeeTable;
